// 生成词云的函数
function generateWordCloud(wordData) {
    
    const container = document.getElementById('wordcloudContent');
    if (!container) {
        console.error('错误：找不到词云容器 wordcloudContent');
        return;
    }
    
    // 清空容器
    container.innerHTML = '';
    
    // 创建词云元素
    const wordCloudDiv = document.createElement('div');
    wordCloudDiv.style.position = 'relative';
    wordCloudDiv.style.width = '100%';
    wordCloudDiv.style.height = '100%';
    
    // 将词数据转换为数组并排序
    const words = Object.entries(wordData).sort((a, b) => b[1] - a[1]);
    
    // 为每个词创建元素
    words.forEach(([word, size], index) => {
        const span = document.createElement('span');
        span.textContent = word;
        span.style.position = 'absolute';
        span.style.fontSize = `${12 + size / 3}px`;
        span.style.fontWeight = size > 30 ? 'bold' : 'normal';
        span.style.color = getWordColor(index);
        span.style.cursor = 'pointer';
        span.style.transition = 'all 0.3s ease';
        span.style.left = `${Math.random() * 60 + 20}%`;
        span.style.top = `${Math.random() * 70 + 15}%`;
        span.style.transform = 'translate(-50%, -50%)';
        span.style.whiteSpace = 'nowrap';  // 防止换行
        span.style.userSelect = 'none';    // 防止选中文字
        
        // 添加悬停效果
        span.addEventListener('mouseenter', function() {
            this.style.transform = 'translate(-50%, -50%) scale(1.2)';
            this.style.zIndex = '10';
        });
        
        span.addEventListener('mouseleave', function() {
            this.style.transform = 'translate(-50%, -50%) scale(1)';
            this.style.zIndex = '1';
        });
        
        wordCloudDiv.appendChild(span);
    });
    
    container.appendChild(wordCloudDiv);
}

// 获取词云颜色
function getWordColor(index) {
    const colors = [
        '#ff6b6b', '#4ecdc4', '#45b7d1', '#96ceb4', 
        '#f7b731', '#5f27cd', '#00d2d3', '#ff9ff3',
        '#54a0ff', '#48dbfb', '#1dd1a1', '#feca57'
    ];
    return colors[index % colors.length];
}

// 显示文章函数
function showRailArticle(id) {
    
    const article = railwayArticles[id];
    if (article) {
        
        document.getElementById('railArticleTitle').textContent = article.title;
        document.getElementById('railArticleBody').innerHTML = article.content;
        document.getElementById('railArticleContainer').classList.add('show');
        document.getElementById('railButtonsWrapper').classList.add('hidden');
        
        // 生成词云
        if (article.wordcloud) {
            setTimeout(() => {
                generateWordCloud(article.wordcloud);
            }, 300); // 延迟生成，确保动画完成
        } else {
            console.warn('文章没有词云数据');
        }
    } else {
        console.error('找不到文章，ID:', id);
    }
}

// 关闭文章函数
function closeRailArticle() {
    console.log('关闭文章');
    document.getElementById('railArticleContainer').classList.remove('show');
    document.getElementById('railButtonsWrapper').classList.remove('hidden');
    
    // 清空词云
    const container = document.getElementById('wordcloudContent');
    if (container) {
        container.innerHTML = '<div class="wordcloud-placeholder"><p>词云加载中...</p></div>';
        console.log('词云容器已重置');
    }
}

// DOM加载完成后执行
document.addEventListener('DOMContentLoaded', function() {
    console.log('DOM加载完成，初始化事件监听器');
    
    // 点击背景关闭
    const articleContainer = document.getElementById('railArticleContainer');
    if (articleContainer) {
        articleContainer.addEventListener('click', function(e) {
            if (e.target === this) {
                console.log('点击背景，关闭文章');
                closeRailArticle();
            }
        });
        console.log('背景点击事件监听器已添加');
    } else {
        console.error('找不到文章容器 railArticleContainer');
    }

    // ESC键关闭
    document.addEventListener('keydown', function(e) {
        if (e.key === 'Escape') {
            const container = document.getElementById('railArticleContainer');
            if (container && container.classList.contains('show')) {
                console.log('按下ESC键，关闭文章');
                closeRailArticle();
            }
        }
    });
    console.log('ESC键事件监听器已添加');
    
    // 检查所有必要的元素是否存在
    const elements = {
        'railArticleContainer': document.getElementById('railArticleContainer'),
        'railButtonsWrapper': document.getElementById('railButtonsWrapper'),
        'railArticleTitle': document.getElementById('railArticleTitle'),
        'railArticleBody': document.getElementById('railArticleBody'),
        'wordcloudContent': document.getElementById('wordcloudContent')
    };
    
    for (const [name, element] of Object.entries(elements)) {
        if (element) {
            console.log(`✓ 元素存在: ${name}`);
        } else {
            console.error(`✗ 元素缺失: ${name}`);
        }
    }
});

